import React from "react";
import { FaTimes } from "react-icons/fa";

const Model = () => {
  return (
    <div className="model">
      <p className="modalcontent">
        Control how much text is generated with a number suffix, such as lorem10
        to generate 10 words of dummy text.
      </p>
      <FaTimes></FaTimes>
    </div>
  );
};

export default Model;
